def can_form_square(matchsticks):
    if len(matchsticks) <= 4:
        return False
    total_length = sum(matchsticks)
    if total_length % 4 != 0:
        return False
    side_length = total_length // 4
    matchsticks.sort(reverse=True)
    if side_length < matchsticks[0]:
        return False

    def dfs(used, start_index, target, remain_rounds):
        if remain_rounds == 0:
            return True
        for i in range(start_index, len(matchsticks)):
            if i in used:
                continue
            num = matchsticks[i]
            if num > target:
                continue
            new_used = used | {i}
            if num == target:
                if dfs(new_used, 0, side_length, remain_rounds - 1):
                    return True
            elif dfs(new_used, i + 1, target - num, remain_rounds):
                return True
        return False
    return dfs(set(), 0, side_length, 4)

